import React, { Component } from 'react';
import './App.css';
import { ResponsiveBar } from '@nivo/bar';

class App extends Component {
  render() {
    return (
      <div className="App" height="900px">
        <button type="button" class="btn">Basic</button>
        <ResponsiveBar
          data = {[
            {
              "value": "very_educated", 
              "percent": 45,
              "percentColor": "#000000",
            },
            {
              "value": "somewhat_educated",
              "percent": 26,
              "percentColor": "#000000",
            },
            {
              "value": "not_too_educated", 
              "percent": 13,
              "percentColor": "#000000",
            },
            {
              "value": "not_at_all_educated", 
              "percent": 15,
              "percentColor": "#000000",
            },
          ]}
          indexBy="value"
          keys={[
            "percent",
          ]}
          margin={{
            "top": 50,
            "right": 130,
            "bottom": 50,
            "left": 60
          }}
          padding={0.3}
          groupMode="grouped"
          colors="nivo"
          borderColor="inherit:darker(1.6)"
        />
      </div>
    );
  }
}

export default App;
